import React from 'react'
import PropTypes from 'prop-types'
import {useState} from 'react';
import {GetAllProject} from '../HuddleComponents/GetAllProjects.js';
export default function Header(props) {
    const [searchAreaInputVal, setSearchAreaInputVal] = useState("");
    // Input Field handler
    const handlesearchInputVal = (e) => {
        setSearchAreaInputVal(e.target.value);
    };
    // Reset Input Field handler
    const resetserachAreaInput = () => {
        setSearchAreaInputVal("");
    };
    return (
        <>
            <div class="col-11 col-xl-2">
                <h1 class="mb-0 site-logo"><a href="index.html" class="text-white mb-0">Brand</a></h1>
            </div>
            <div class="col-12 col-md-10 d-none d-xl-block">
<nav class="site-navigation position-relative text-right" role="navigation">
<ul class="site-menu js-clone-nav mr-auto d-none d-lg-block">
<li class="active"><a href="index.html"><span>Home</span></a></li>
<li class="has-children">
<a href="about.html"><span>Dropdown</span></a>
<ul class="dropdown arrow-top">
<li><a href="#">Menu One</a></li>
<li><a href="#">Menu Two</a></li>
<li><a href="#">Menu Three</a></li>
<li class="has-children">
<a href="#">Dropdown</a>
<ul class="dropdown">
<li><a href="#">Menu One</a></li>
<li><a href="#">Menu Two</a></li>
<li><a href="#">Menu Three</a></li>
<li><a href="#">Menu Four</a></li>
</ul>
</li>
</ul>
</li>
<li><a href="listings.html"><span>Listings</span></a></li>
<li><a href="about.html"><span>About</span></a></li>
<li><a href="blog.html"><span>Blog</span></a></li>
<li><a href="contact.html"><span>Contact</span></a></li>
</ul>
</nav>
</div>
<div class="d-inline-block d-xl-none ml-md-0 mr-auto py-3" style="position: relative; top: 3px;"><a href="#" class="site-menu-toggle js-menu-toggle text-white"><span class="icon-menu h3"></span></a></div>
        </>
    )
}
Header.defaultProps = {
    title: "The Huddle",
    searchBar : true
}
Header.propTypes = {
    title: PropTypes.string,
    searchBar: PropTypes.bool
}
